CREATE TABLE MediaReview ( MediaReviewPK decimal(11) DEFAULT '0' NOT NULL, RatingValue varchar(255), FreeTextReview text, RatingCriterionFK decimal(11), PRIMARY KEY (MediaReviewPK));
COPY 220 RECORDS INTO "sys"."mediareview" FROM stdin USING DELIMITERS E'\t',E'\n','"';
259	"6.8"	"A man calling himself ""Simon"" begins a reign of terror inthe streets of New York: he threatens to detonate bombs around the cityunless Detective John McClane cooperates in a game of ""Simon Says"".McClane has a bad hangover and a bad attitude, and isn't in the moodfor games, especially this one."	1
284	"7.0"	"The story of the Buckman family and friends, attempting to bring up theirchildren.  They suffer/enjoy all the events that occur: estrangedrelatives, the ""black sheep"" of the family, the eccentrics, theskeletons in the closet, and the rebellious teenagers."	1
309	"6.6"	"In 15th century Paris, Clopin the puppeteer tells the story of Quasimodo,the misshapen gentle-souled bell ringer of Notre Dame, who was nearlykilled as a baby by Claude Frollo, the Minister of Justice. But Frollowas forced by the Archdeacon of Notre Dame to raise Quasimodo as hisown. Now a young man, Quasimodo is hidden from the world by Frollo inthe belltower of the cathedral. But during the Festival of Fools,Quasimodo, cheered on by his gargoyle friends Victor, Hugo, andLaverne, decides to take part in the festivities, where he meets thelively gypsy girl Esmeralda and the handsome soldier Phoebus. The threeof them find themselves ranged against Frollo's cruelty and hisattempts to destroy the home of the gypsies, the Court of Miracles. AndQuasimodo must desperately defend both Esmeralda and the very cathedralof Notre Dame."	1
362	"6.0"	"After being trapped in a jungle board game for 26 years, a Man- Child(Robin Williams) wins his release from the game. But, no sooner has hearrived that he is forced to play again, and this time sets thecreatures of the jungle loose on the city. Now it is up to him to stopthem."	1
