5397	"8.6"	"Renowned archeologist and expert in the occult, Dr. Indiana Jones, is hiredby the U.S. Government to find the Ark of the Covenant, which isbelieved to still hold the ten commandments.   Unfortunately, agents ofHitler are also after the Ark.   Indy, and his ex-flame Marion, escapefrom various close scrapes in a quest that takes them from Nepal toCairo."	1
5422	"8.5"	"In ""Toy Story 2,"" the fun and adventure continues when Andy goes off tosummer camp and the toys are left to their own devices. Things shiftinto high gear when an obsessive toy collector kidnaps Woody whounbeknownst to himself is a highly valued collectable. It's now up toBuzz Lightyear and the gang from Andy's room - Mr. Potato Head, SlinkyDog, Rex and Hamm - to spring into action and save their pal from windingup as a museum piece. There's plenty of excitement and fun as the toysget into one predicament after another in their daring race to get homebefore Andy does."	1
5448	"6.8"	"Men in Black follows the exploitsof agents Kay (Jones) and Jay (Smith), members of a top-secretorganization established to monitor and police alien activity onEarth. The two Men in Black find themselves in the middle of thedeadly plot by an intergalactic terrorist (Vincent D'Onofrio) whohas arrived on Earth to assassinate two ambassadors from opposinggalaxies. In order to prevent worlds from colliding, the MiB musttrack down the terrorist and prevent the destruction of Earth.It's just another typical day for the Men in Black."	1
5473	"7.1"	"Gotham City: dark, dangerous, 'protected' only by a mostly corrupt policedepartment.  Despite the best efforts of D.A. Harvey Dent and policecommissioner Jim Gordon, the city becomes increasingly unsafe...until aDark Knight arises.  We all know criminals are a superstitious,cowardly lot...so his disguise must be able to strike terror into theirhearts.  He becomes a bat. Enter Vicky Vale, a prize-winningphoto journalist who wants to uncover the secret of the mysterious""bat-man"".  And enter Jack Napier, one-time enforcer for Boss Grissom,horribly disfigured after a firefight in a chemical factory...who,devoid of the last vestiges of sanity, seizes control of Gotham'sunderworld as the psychotic, unpredictable Clown Prince of Crime...theJoker. Gotham's only hope, it seems, lies in this dark, broodingvigilante.  And just how does billionaire playboy Bruce Wayne fit intoall of this?"	1
5498	"6.5"	"Based on the book by the famous Dr. Seuss. Inside a snowflake exists themagical land of Whoville. In Whoville, live the Who's, an almostmutated sort of munchkinlike people. All the Who's love Christmas, yetjust outside of their beloved Whoville lives the Grinch. The Grinch isa nasty creature that hates Christmas, and plots to steal it away fromthe Whos which he equally abhors. Yet a small child, Cindy Lou Who,decides to try befriend the Grinch."	1
5523	"8.2"	"The peaceful community of Amity island is being terrorised. There issomething in the sea that is attacking swimmers. They can no longerenjoy the sea and the sun as they used to, and the spreading fear isaffecting the numbers of tourists that are normally attracted to thisisland. After many attempts the great white shark won't go away andsheriff Brody, with friends Hooper and Quint decide to go after theshark and kill it."	1
5548	"6.1"	"In this film, Macaulay Culkin is an eight years old boy that is left athome by his parents, when they leave with the rest of the family forChristmas holidays to Paris. At first he seems to enjoy living alone,but after a while he understands that things aren't so easy. Especiallywhen two robbers deside to break in a particular house. HIS house! Ishe able to defend his home?"	1
5572	"8.6"	"Darth Vader is helping the Empire crush the rebelliondetermined to end the Empire's domination of the universe.   The rebelsare based on Hoth, and when troops arrive to wipe them out, Han Soloand Princess Leia flee to Cloud City.   Luke Skywalker, in a bid tostrengthen his knowledge of the force, finds Yoda, one of the finestJedis ever. Will they be able to get back together and halt the Empiresprogress ?"	1
5597	"8.5"	"Malcom Crowe is a child psychologist who receives an award on the samenight that he is visited by a very unhappy ex-patient. After thisencounter, Crowe takes on the task of curing a young boy with the sameills as the ex-patient. This boy ""sees dead people"". Crowe spends a lotof time with the boy (Cole) much to the dismay of his wife. Cole's mom isat her wit's end with what to do about her son's increasing problems.Crowe is the boy's only hope."	1
5621	"6.0"	"On July 2nd, communications systems worldwide are sent into chaos by astrange atmospheric interference. It is soon learned by the militarythat a number of enormous objects are on a collision course with Earth.At first thought to be meteors, they are later revealed to be giganticspacecraft, piloted by a mysterious alien species. After attempts tocommunicate with the aliens go nowhere, David Levinson, an ex-scientistturned cable technician, discovers that the aliens are going to attackmajor points around the globe in less than a day. On July 3rd, thealiens all but obliterate New York, Los Angeles, and Washington. Thesurvivors set out in convoys towards Area 51, a strange governmenttesting ground where it is rumored the military has a captured alienspacecraft of their own. The survivors devise a plan to fight backagainst the enslaving aliens, and July 4th becomes the day humanitywill fight for its freedom. July 4th is their Independence Day..."	1
5647	"8.0"	"Darth Vader and the Empire are building a new, indestructible Death Star. Meanwhile, Han Solo has been imprisoned, and Luke Skywalker has sentR2D2 and C3PO to try and free him.   Princess Leia - disguised as abounty hunter - and Chewbacca go along as well.   The final battletakes place on the moon of Endor, with its natural inhabitants, theEwoks, lending a hand to the rebels.   Will Darth Vader and the darkside overcome the rebels and take over the universe ?"	1
5672	"7.5"	"A young lion prince is born in Africa, thus making his uncle Scarthe second in line to the throne. Scar plots with the hyenas to killKing Mufasa and Prince Simba, thus making himself King. The King iskilled and Simba is led to believe by Scar that it was his fault, andso flees the kingdom in shame. After years of exile he is persuaded toreturn home to overthrow the usurper and claim the kingdom as his ownthus completing the ""Circle of Life""."	1
5698	"7.8"	"The story follows the life of low I.Q. Forrest Gump (Tom Hanks)and his meeting with the love of his life Jenny. The filmchronicles his accidental experiences with some of the mostimportant people and events in America from the late 1950'sthrough the 1970's including a meeting with Elvis Presley, JFK,Lyndon Johnson, Richard Nixon, fighting in Vietnam, etc. Theproblem is, he's too stupid to realize the significance of hisactions. Forrest becomes representative of the baby boomergeneration having walked through life blindly."	1
5723	"7.2"	"Scientists develop a means of bringing dinosaurs to life using DNA takenfrom dino' blood, which has been preserved inside insects encased inamber. Whilst Hammond is showing off his dinosaur 'theme park' to aselected audience [a lawyer (Gerrano), mathematician (Malcolm), dino'expert (Grant), palaeobotanist (Sattler) and his grandchildren (Tim  and Lex)], Nedry (computer expert) disables the security system so that hecan make his escape with some stolen embryos. This enables all thedinosaurs to escape their enclosures... Look out the dinosaurs arecoming !"	1
5748	"7.7"	"A group of aliens visit earth and one of them is lost and left behindstranded on this planet. The alien is found by a 10 year old boy,Elliot. Soon the two begin to communicate, and start a different kindof friendship in which E.T learns about life on earth and Elliot learnsabout some new values for the true meaning of friendship.   E.T. wantsto go home, but if Elliot helps him, he'll lose a friend..."	1
5772	"7.2"	"This First Episode follows the young years of Anakin Skywalker (DarthVader). The friendship of Obi-wan Kenobi, Yoda and Qui-Gon Jinn arealso central aspects. And the beginning of the rise to power of SenatorPalpatine to Emperor."	1
5796	"8.8"	"Part IV in a George Lucas epic, Star Wars: A New Hope opens witha rebel ship being boarded by the tyrannical Darth Vader. Theplot then follows the life of a simple farmboy, Luke Skywalker,as he and his newly met allies (Han Solo, Chewbacca, Ben Kenobi,C-3PO, R2-D2) attempt to rescue a rebel leader, Princess Leia,from the clutches of the Empire. The conclusion is culminated asthe Rebels, including Skywalker and flying ace Wedge Antillesmake an attack on theEmpires most powerful and ominous weapon, the Death Star."	1
5820	"7.2"	"Its name stirs the imagination... Titanic. The unsinkable ship. Theunimaginable catastrophe. The untold stories that lay in mystery twoand a half miles beneath the waves of the North Atlantic. What buriedtale of love, bravery, treasure and treachery, hidden by time andtragedy, waits here to be discovered? A beautiful socialite. Apenniless artist. A priceless diamond. A romance so passionate thatnothing on earth could stop it. A destiny so incredible that no onecould have imagined it. A collision of lives that could only havehappened on Titanic, the ship of dreams. The secrets are about tounfold..."	1

